import React from 'react';
import './temconfig.css';

const SetTemperature=()=>{
    return(
        <form className='temperature-form'>
            <label for="temperature">Set Temperature: </label>
            <input type="text" id="temperature" name="temperature" placeholder="Enter New Temperature.."/>
            <input type="submit" id="submit" value="Submit"/>
        </form>
    )
}
export default SetTemperature;
